import React from "react";
import { Link } from "react-router-dom";

const FreshStories = () => {
  return (
    <section className="centerThis">
      <div className="container">
        <h3>Try this activity quiz</h3>
      </div>
      <button><Link to="/Setting">Start Quiz</Link></button>
    </section>
  );
};

export default FreshStories;
